'  is',
'    l_error varchar2(4000);',
'    pragma autonomous_transaction;',
'  begin',
'    $if $$no_op $then',
'      null;',
'    $else',
'      if ok_to_log(nvl(p_level, logger.g_debug)) then',
'',
'        $if $$apex $then',
