'gc_pref_logger_debug constant logger_prefs.pref_name%type := ''LOGGER_DEBUG'';                                                                                                                            ',
'gc_pref_plugin_fn_error constant logger_prefs.pref_name%type := ''PLUGIN_FN_ERROR'';                                                                                                                      ',
'-- *** PRIVATE ***                                                                                                                                                                                      ',
