'p_date_stop  in date)                                                                                                                                                                                   ',
'return varchar2                                                                                                                                                                                         ',
'as                                                                                                                                                                                                      ',
'x varchar2(20);                                                                                                                                                                                         ',
'begin                                                                                                                                                                                                   ',
'return null;                                                                                                                                                                                            ',
