'/**                                                                                                                                                                                                     ',
'* Parses the callstack to get unit and line number                                                                                                                                                      ',
'*                                                                                                                                                                                                       ',
'* Notes:                                                                                                                                                                                                ',
'*  - Private                                                                                                                                                                                            ',
'*                                                                                                                                                                                                       ',
'* Related Tickets:                                                                                                                                                                                      ',
'*  -                                                                                                                                                                                                    ',
'*                                                                                                                                                                                                       ',
'* @author Tyler Muth                                                                                                                                                                                    ',
'* @created ???                                                                                                                                                                                          ',
'* @param p_callstack                                                                                                                                                                                    ',
'* @param o_unit                                                                                                                                                                                         ',
'* @param o_lineno                                                                                                                                                                                       ',
'*/                                                                                                                                                                                                      ',
'procedure get_debug_info(                                                                                                                                                                               ',
