'/**                                                                                                                                                                                                     ',
'* Sets the logger level                                                                                                                                                                                 ',
'*                                                                                                                                                                                                       ',
'* Notes:                                                                                                                                                                                                ',
'*  -                                                                                                                                                                                                    ',
