'*  - #48 Allow of numbers to be passed in p_level. Did not overload (see ticket comments as to why)                                                                                                     ',
'*  - #110 Clear context values when level changes globally                                                                                                                                              ',
'*  - #29 If p_level is deprecated, set to DEBUG                                                                                                                                                         ',
'*                                                                                                                                                                                                       ',
'* @author Tyler Muth                                                                                                                                                                                    ',
