'l_expiry_date logger_prefs_by_client_id.expiry_date%type;                                                                                                                                               ',
'l_id logger_logs.id%type;                                                                                                                                                                               ',
'pragma autonomous_transaction;                                                                                                                                                                          ',
'begin                                                                                                      '))
);
