'return to_char(p_val, gc_timestamp_format);                                                                                                                                                             ',
'end tochar;                                                                                                                                                                                             ',
'function tochar(                                                                                                                                                                                        ',
'p_val in timestamp with time zone)                                                                                                                                                                      ',
