'return to_char(p_val, gc_timestamp_tz_format);                                                                                                                                                          ',
'end tochar;                                                                                                                                                                                             ',
'-- #119: Return null for null booleans                                                                                                                                                                  ',
'function tochar(                                                                                                                                                                                        ',
'p_val in boolean)                                                                                                                                                                                       ',
'return varchar2                                                                                                                                                                                         ',
